<h1>ftplib_deinit</h1>
<p>Uninitialize the <i>ftplib</i> library.

<h2>SYNOPSIS</h2>
<pre>
#include &lt;ftplib.h&gt;
void ftplib_deinit(void);
</pre>

<h2>PARAMETERS</h2>
<p>None.

<h2>DESCRIPTION</h2>
<p>Performs any required uninitialization for the library.

<h2>RETURN VALUE</h2>
<p>None.
